.cat *{
    box-sizing:border-box;margin:0;padding:0;
}
.cat *::before{box-sizing:border-box;}
.cat *::after{box-sizing:border-box;}
.cat{
    border:5px solid red;
    width:500px;
    height:500px;
    position:relative;
    background: rgb(22, 22, 22);
    min-height:100vh;
}
.ear{
    border:1px solid red;
    width:45px;
    height:100px;
    position:absolute;
    top:70px;
    left:50%;
    border-radius:30% 70% 0 0 / 100% 100% 0 0;
    transform:rotate(20deg);
}
.ear>.left{
    left: -7%;
    border-radius: 70% 30% 0% 0% / 100% 100% 0% 0%;
    transform: rotate(-15deg);
}

.face{
    border:1px solid black;
    position: absolute;
    height: 200px;
    width: 200px;
    top :150px;
    margin-left:300px;
    background: black;
    border-radius: 50%;
}

.muzzle{
    border:1px solid green;
    width:10px;
    height:6px;
    position:absolute;
    top:65px;
    left:50%;
    background:#fff;
    margin-left:-3px;
    border-radius:50% 50% 50% 50% / 30% 30% 70% 70%;
}
.eye{
    border:1px solid black;
    top:40px;
    left:50%;
    margin-left:-15px;
    width:36px;
    height:32px;
    position:absolute;
    background:#fff;
    border-radius: 50% 50% 50% 50% / 60% 60% 40% 40%;
}
.eye.left{
    transform:translateX(-40px);
}
.eye.right{
    transform:translateX(40px);
}

.eye.left::after{
    content: '';
    position: absolute;
    top: 70%;
    right: -1%;
    height: 20%;
    width: 50%;
    border-radius: 70%;
    background: #ffffff;
}
.eye.right::after {
    content: '';
    position: absolute;
    top: 70%;
    right:51%;
    height: 20%;
    width: 50%;
    border-radius: 70%;
    background: #ffffff;
}
@keyframes blink{
    0%{height:0;}
    90%{height: 0;}
    92.5%{height:100%}
    95%{height: 0;}
    97.5%{height: 100%}
    100%{height:0;}
}

.eye>.pupil{
    position:absolute;
    top:25%;
    left:30%;
    height:55%;
    width:28%;
    background:black;
    border-radius: 50%;
    animation:look-ground 4s infinite;
}
@keyframes look-ground {
    0% { transform: translate(0) }
    5% { transform: translate(100%, -20%) }
    10% { transform: translate(100%, -20%) }
    15% { transform: translate(-15%, -20%) }
    20% { transform: translate(-5%, -20%) }
    25% { transform: translate(0, 0) }
    100% { transform: translate(0, 0) }
}
.pupil::after {
    content: '';
    position: absolute;
    top:20%;
    right:20%;
    height: 30%;
    width: 30%;
    background: #fff;
    border-radius: 50%;
}
